local p = game:GetService("Players")
local g = game:GetService("StarterGui")

-- tables xd
local c = {
    H = {"Hell", "hell", "H3LL", "HELL", "h3ll"},
    D = {"Devils", "devils", "D3vils", "Devil", "devil"},
    M = {"MNX", "mnx", "mNX", "mnX", "MNXX"},
    S = {"Sunx", "sunx", "sunX", "SuNX", "suNX"}  
}


local i = {
    H = {d = "Un clan lleno de reachers y clumnsy users, su owner es un lammer y maricon", o = "Gere"},
    D = {d = "Puros newgen y pendejos XD", o = "DevilsMuerte"},
    M = {d = "Otro clan random de skywars, son legales pero muy malos", o = "Sun"},
    S = {d = "El owner es un peruano lloron maricon y sus niembros son muy malos", o = "Juan"}  
}

--La iteracion para detectar a los maricones xd

local function d(p)
    local n = p.Name .. " " .. p.DisplayName
    for k, v in pairs(c) do
        for _, a in ipairs(v) do
            if string.find(string.lower(n), string.lower(a)) then
                g:SetCore("ChatMakeSystemMessage", {
                    Text = "  CLAN DETECTOR: [" .. p.DisplayName .. "] [" .. a .. "] [" .. i[k].d .. "] [Owner: " .. i[k].o .. "]",
                    Color = Color3.fromRGB(0, 0, 255)
                })
                return
            end
        end
    end
end

--inicio y llamada de funciones para que funcione;
p.PlayerAdded:Connect(d)
for _, pl in pairs(p:GetPlayers()) do d(pl) end
